<?php

namespace Appleton\Taxes\Seeds;

use Appleton\Taxes\Countries\US\Alabama\MossesOccupational;
use DB;
use Illuminate\Database\Seeder;

class MossesSeeder extends Seeder
{
    public function run()
    {
        $id = DB::table('governmental_unit_areas')->insertGetId([
            'name' => 'Mosses, AL',
            'area' => '',
        ]);

        DB::table('tax_areas')->insert([
            'name' => 'Mosses Occupational Tax',
            'tax' => MossesOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
